import styled from "styled-components";

const PostWrite = (props) => {
  return (
    <React.Fragment>
      <Inputwrapper>
        <div>
          <input style={{width: 700}} placeholder="제목을 입력하세요" />
        </div>
        <div>
          <input placeholder="글쓴이를 입력하세요" />
        </div>
        <div>
          <input placeholder="내용을 입력하세요" />
        </div>
        <button>저장</button>
      </Inputwrapper>
    </React.Fragment>
  );
};

const Inputwrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;
export default PostWrite;
